INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CATY', 'STOCK', 'Cathay General Bancorp', 'NMS', 'Financial Services', 'Banks - Regional', 'Cathay General Bancorp is the holding company of Cathay Bank (the Bank). The Bank offers a range of financial services and operates over 60 branches across the United States in California, New York, Washington, Texas, Illinois, Massachusetts, Maryland, Nevada, and New Jersey. It also has a branch outlet in Hong Kong, and representative offices in Beijing, Shanghai, and Taipei. The Bank provides financial services to diverse commercial and professional businesses in its market areas. It offers products and services to businesses, such as checking and deposit, lines of credits, commercial and commercial real estate loans, merchant services and payment processing, treasury management services, international banking and financing services, and other customary banking services. Through its Cathay Wealth Management business unit, the Bank offers clients a range of investment products and services, such as stocks, bonds, mutual funds, insurance, annuities, and advisory services.', 'Los Angeles, CA, United States', 1266);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BPOP', 'STOCK', 'Popular, Inc.', 'NMS', 'Financial Services', 'Banks - Regional', 'Popular, Inc. (Popular) is a financial holding company. The Company operates in two segments: Banco Popular de Puerto Rico (BPPR), which includes its Puerto Rico business, and Banco Popular North America (BPNA), which includes its the United States mainland business. The Company has operations in Puerto Rico, the United States and the Caribbean. The Company''s BPPR segment provides retail, mortgage and commercial banking services through its banking subsidiary, Banco Popular de Puerto Rico, as well as auto and equipment leasing and financing, investment banking, broker-dealer and insurance services through specialized subsidiaries. The Company''s BPNA segment consists of Popular North America, Inc. (PNA) functioning as the holding company for its operations in the United States. It also operates PNA''s subsidiary, E-LOAN, Inc. The banking operations of BPNA in the United States mainland are based in New York, Florida and New Jersey, conducted under the name of Popular Community Bank.', 'Hato Rey, PR, United States', 9303);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVTR', 'STOCK', 'Eaton Vance Total Return Bond ETF', 'NYQ', NULL, NULL, 'Under normal circumstances, at least 80% of the fund’s net assets (plus the amount of any borrowings for investment purposes) will be invested in fixed-income securities. The fund invests primarily in a diversified mix of U.S. dollar-denominated investment grade fixed-income securities, including U.S. government, corporate, municipal, mortgage- and asset-backed securities.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BVFL', 'STOCK', 'BV Financial, Inc.', 'NCM', 'Financial Services', 'Banks - Regional', 'BV Financial, Inc. is the parent company of BayVanguard Bank (the Bank). The Bank is headquartered in Baltimore, Maryland with thirteen branches in the Baltimore metropolitan area and the eastern shore of Maryland. The Bank is a full-service community-oriented financial institution dedicated to serving the financial service needs of consumers and businesses. The Bank is engaged primarily in the business of attracting deposits from the public and using such funds to originate one-to-four-family real estate, construction, multifamily, commercial real estate, farm, marine loans, commercial and consumer loans. The Banks personal and business banking services include checking and money market accounts, certificates of deposit, savings, online banking, personal and business credit cards, and other services. The Banks lending services include personal and commercial lending, which offers real estate, lines of credit, home equity, construction, auto, boat, lot, and other loan services.', 'Baltimore, MD, United States', 109);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZD', 'STOCK', 'Direxion Daily AMZN Bear 1X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of the it’s net assets (plus borrowings for investment purposes) in financial instruments, including swap agreements and options, that, in combination, provide 1X daily inverse (opposite) or short exposure to AMZN, consistent with the fund’s investment objective. It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BMR', 'STOCK', 'Beamr Imaging Ltd.', 'NCM', 'Technology', 'Software - Application', 'Beamr Imaging Ltd is an Israel-based video technology and image science software company. Beamr Imaging Ltd provides video encoding, transcoding, and optimization software solutions that enable high quality, performance, and bitrate efficiency for live and Video on Demand (VOD) video services. Company''s product portfolio includes Codec SDKs- software development kit, CABRA Library is a Content Adaptive BitRate rate control library that integrates with existing hardware and software video encoders to reduce bitrates. JPEGmini Photo Opitmizer- a patented photo recompression technology which reduces the size of photographs without affecting their perceptual quality. Beamr Imaging Ltd operates globally.', 'Herzliya, , Israel', 38);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLKB', 'STOCK', 'Blackbaud, Inc.', 'NMS', 'Technology', 'Software - Application', 'Blackbaud, Inc. provides software for powering social impact. It enhances its software with a range of payment processing, analytic and business intelligence services, consulting, training and professional services, and maintenance and technical support. Its specific solutions and services include fundraising and engagement, financial management, grant and award management, education solutions, social responsibility, employee giving and volunteering, payment services, data intelligence, customer success, customer support, professional and managed services and training. Its fundraising and engagement include Blackbaud Raiser''s Edge NXT, Blackbaud CRM, Blackbaud eTapestry, Blackbaud Luminate Online, Blackbaud TeamRaiser, JustGiving from Blackbaud, Blackbaud Fundraiser Performance Management, Blackbaud Altru, and Blackbaud Guided Fundraising and Blackbaud Volunteer Network Fundraising. Its grant and award management solutions include Blackbaud Grantmaking and Blackbaud Award Management.', 'Charleston, SC, United States', 2600);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AYTU', 'STOCK', 'Aytu BioPharma, Inc.', 'NCM', 'Healthcare', 'Drug Manufacturers - Specialty & Generic', 'Aytu BioPharma, Inc. is a pharmaceutical company focused on commercializing novel therapeutics. The Company''s business is focused on its prescription pharmaceutical products sold primarily through third party wholesalers and pharmacies and which primarily consists of two product portfolios. The first consists of two products for the treatment of ADHD: Adzenys XR-ODT (amphetamine) extended-release orally disintegrating tablets (Adzenys) and Cotempla XR-ODT (methylphenidate) extended-release orally disintegrating tablets. The second consists primarily of Karbinal ER (carbinoxamine maleate extended-release oral suspension), an extended-release first-generation antihistamine suspension containing carbinoxamine indicated to treat numerous allergic conditions, and Poly-Vi-Flor and Tri-Vi-Flor, two complementary prescription fluoride-based supplement product lines containing combinations of fluoride and vitamins in various formulations for infants and children with fluoride deficiency.', 'Denver, CO, United States', 102);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEP', 'STOCK', 'Brookfield Renewable Partners L.P.', 'NYQ', 'Utilities', 'Utilities - Renewable', 'Brookfield Renewable Partners L.P. owns a portfolio of renewable power generating facilities in North America, Colombia, and Brazil. The company generates electricity through hydroelectric, wind, solar, distributed generation, and pumped storage; and offers sustainable solutions, such as renewable natural gas, carbon capture and storage, recycling, cogeneration, biomass, nuclear services, eFuels, and power transformation. Brookfield Renewable Partners Limited operates as the general partner of Brookfield Renewable Partners L.P. The company was formerly known as Brookfield Renewable Energy Partners L.P. and changed its name to Brookfield Renewable Partners L.P. in May 2016. The company was founded in 1999 and is based in Toronto, Canada.', 'Toronto, ON, Canada', 5270);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DOLE', 'STOCK', 'Dole plc', 'NYQ', 'Consumer Defensive', 'Farm Products', 'Dole plc is an Ireland-based company, which produces, markets, and distributes an extensive variety of fresh fruits and vegetables sourced locally and from around the world. The Company''s segments include Fresh Fruit, Diversified Fresh Produce - EMEA and Diversified Fresh Produce - Americas & ROW. Its Fresh Fruit segment primarily sells bananas and pineapples which are sourced from local growers or Company-owned and leased farms, predominately located in Latin America, and sold throughout North America, Europe, Latin America and Asia. This segment also operates a commercial cargo business. The Company''s Diversified Fresh Produce - EMEA segment includes its Irish, Dutch, Spanish, Portuguese, French, Italian, United Kingdom, Swedish, Danish, South African, Czech, Slovakian, Polish, German and Brazilian businesses. The Diversified Fresh Produce - Americas & ROW segment includes its United States, Canadian, Mexican, Chilean, Peruvian and Argentinian businesses.', 'Dublin, , Ireland', 35371);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLD', 'STOCK', 'TopBuild Corp.', 'NYQ', 'Industrials', 'Engineering & Construction', 'TopBuild Corp. is an installer and specialty distributor of insulation and related building material products to the construction industry in the United States and Canada. The Companys segments include Installation and Specialty Distribution. The Installation segment primarily installs insulation and other building products. Installation sells primarily to the residential new construction market, commercial/industrial construction market, along with repair/remodel of residential housing. In addition to insulation, it installs other building products, including glass and windows, rain gutters, garage doors, closet shelving, and fireplaces, among other items. The Specialty Distribution segment distributes building and mechanical insulation, insulation accessories and other building product materials for the residential and commercial/industrial end markets. In addition to insulation and accessories, it distributes rain gutters, closet shelving, and roofing materials, among other items.', 'Daytona Beach, FL, United States', 13984);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CMTL', 'STOCK', 'Comtech Telecommunications Corp.', 'NMS', 'Technology', 'Communication Equipment', 'Comtech Telecommunications Corp. is a global technology company. The Company is engaged in providing terrestrial and wireless network solutions, next-generation 9-1-1 emergency services, satellite and space communications technologies, and cloud native capabilities to commercial and government customers around the world. It operates through two segments: Satellite and Space Communications, and Terrestrial and Wireless Networks. Its Satellite and Space Communications segment designs, builds and supports a variety of sophisticated communications equipment critical to modern communications infrastructures. Satellite and Space Communications segment is organized into four categories: satellite modem and amplifier technologies, troposcatter technologies, government services and space components. The Terrestrial and Wireless Networks segment has three service areas: next generation 911 and call delivery, Solacom call handling solutions, and trusted location and messaging solutions.', 'Chandler, AZ, United States', 1468);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DFH', 'STOCK', 'Dream Finders Homes, Inc.', 'NYQ', 'Consumer Cyclical', 'Residential Construction', 'Dream Finders Homes, Inc. is a homebuilder based in Jacksonville, Florida. The Company''s primary focus is on constructing and selling single-family homes across entry-level, first-time move-up, second-time move-up, and active adult markets. It builds single-family homes throughout the Southeast, Mid-Atlantic and Midwest, including Florida, Texas, Tennessee, North Carolina, South Carolina, Georgia, Colorado, Arizona, and the Washington, D.C. metropolitan area, which comprises Northern Virginia and Maryland. It also has homebuilding operations and assets in the Atlanta. The Company also owns captive pre-engineered panel and truss and building component import businesses. The Company also provides title insurance and mortgage banking solutions through its wholly owned subsidiaries, Golden Dog Title & Trust and Jet HomeLoans, LP. Its home offerings are marketed under various brands, including Dream Finders Homes, DF Luxury, Craft Homes, and Coventry Homes.', 'Jacksonville, FL, United States', 1686);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CFR', 'STOCK', 'Cullen/Frost Bankers, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Cullen/Frost Bankers, Inc. is a financial holding company and a bank holding company. The Company provides an array of products and services throughout numerous Texas markets. The Company''s segments include Banking and Frost Wealth Advisors. The Banking segment includes both commercial and consumer banking services and Frost Insurance Agency. Commercial banking services are provided to corporations and other business clients and include a wide array of lending and cash management products. Consumer banking services include direct lending and depository services. Frost Insurance Agency provides insurance brokerage services to individuals and businesses covering corporate and personal property and casualty products, as well as group health and life insurance products. The Frost Wealth Advisors segment includes fee-based services within private trust, retirement services, and financial management services, including personal wealth management and securities brokerage services.', 'San Antonio, TX, United States', 5854);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CDZI', 'STOCK', 'Cadiz Inc.', 'NGM', 'Utilities', 'Utilities - Regulated Water', 'Cadiz Inc. is a water solutions provider with a combination of land, water, pipeline, and water filtration assets located in Southern California. The Company''s segments include Land and Water Resources, and Water Filtration Technology. The Land and Water Resources segment comprises all activities regarding its properties in the eastern Mojave Desert pre-revenue development of the Water Project (supply, storage and conveyance), and agricultural operations. The Water Filtration Technology segment comprises ATEC Water Systems LLC, its subsidiary, which provides water filtration solutions for impaired or contaminated groundwater sources. Its portfolio of assets includes over 2.5 million acre-feet of water supply, one million acre-feet of groundwater storage capacity, 220 miles of existing, underground pipeline, and versatile and scalable water filtration technology. It has over 46,000 acres of land with naturally recharging groundwater resources in Southern Californias Mojave Desert.', 'Los Angeles, CA, United States', 25);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVGI', 'STOCK', 'Commercial Vehicle Group, Inc.', 'NMS', 'Consumer Cyclical', 'Auto Parts', 'Commercial Vehicle Group, Inc. is a global provider of systems, assemblies and components to the global commercial vehicle market and the electric vehicle market. The Company delivers solutions to complex design, engineering, and manufacturing problems. The Company operates through three segments: Vehicle Solutions, Electrical Systems and Aftermarket & Accessories. The Vehicle Solutions segment designs, manufactures and sells commercial vehicle seats and plastic and trim components for the global and North America commercial vehicle market. The Electrical Systems segment designs, manufactures and sells cable and harness assemblies for both high and low voltage applications, control boxes, dashboard assemblies and design and engineering for these applications. The Aftermarket & Accessories segment designs, manufactures, and sells seats and components; commercial vehicle accessories including wipers, mirrors, and sensors, and office seats.', 'New Albany, OH, United States', 6400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FFIC', 'STOCK', 'Flushing Financial Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'Flushing Financial Corporation is the holding company for Flushing Bank (the Bank). The Bank offers the products, services, and conveniences associated with large commercial banks, including a full complement of deposit, loan, equipment finance, and cash management services. The Bank''s principal business is attracting retail deposits from the general public and investing those deposits together with funds generated from ongoing operations and borrowings, primarily in originations and purchases of multi-family residential properties loans, commercial business loans, commercial real estate mortgage loans and, to a lesser extent, one-to-four family loans; construction loans; small business administration (SBA) loans; mortgage loan surrogates, such as mortgage-backed securities; and United States government securities, corporate fixed-income securities and other marketable securities. The Bank also operates an Internet branch that operates under the brands of iGObanking.com and BankPurely', 'Uniondale, NY, United States', 571);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMZZ', 'STOCK', 'GraniteShares 2x Long AMZN Daily ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange traded fund that attempts to replicate 2 times (200%) the daily percentage change of the underlying stock by entering financial instruments such as swaps and options on the underlying stock as well as directly purchasing the underlying stock. The fund will aim to primarily obtain its notional exposure against the underlying stock through swap agreements. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EVV', 'STOCK', 'Eaton Vance Limited Duration Income Fund', 'ASE', 'Financial Services', 'Asset Management', 'Eaton Vance Limited Duration Income Fund is a closed-ended fixed income mutual fund launched and managed by Eaton Vance Management. The fund invests in the fixed income markets of the United States. It primarily invests in senior, secured floating-rate loans, government agency mortgage-backed securities, and corporate bonds that are rated below investment grade. The fund seeks to maintain an average duration of three and a half years and average quality BBB/BBB- in its investments. It benchmarks the performance of its portfolio against the S&P/LSTA Leveraged Loan Index, the Merrill Lynch U.S. High Yield Index, and the Barclays Capital U.S. Intermediate Government Bond Index. Eaton Vance Limited Duration Income Fund was formed on May 30, 2003 and is domiciled in the United States.', 'Boston, MA, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBK', 'STOCK', 'FB Financial Corporation', 'NYQ', 'Financial Services', 'Banks - Regional', 'FB Financial Corporation is a bank holding company. The Company operates through its wholly owned banking subsidiary, FirstBank, in Tennessee, Alabama, Kentucky, and Georgia. The Company operates through two segments: Banking and Mortgage. The Company''s Banking segment provides a full range of deposit and lending products and services to corporate, commercial and consumer customers. The Company also originates conforming residential mortgage loans through its Mortgage segment, whose activities include the servicing of residential mortgage loans and securitization of loans to third party private investors or government sponsored agencies. It operates approximately 93 full-service bank branches across its footprint. FirstBank also provides retail mortgage banking services utilizing its bank branch network and mortgage banking offices strategically located throughout the southeastern United States.', 'Nashville, TN, United States', 1490);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('NXXT', 'STOCK', 'NextNRG Inc.', 'NCM', 'Utilities', 'Utilities - Renewable', 'NextNRG, Inc., formerly EzFill Holdings, Inc., is focused on renewable energy, mobile fueling, and energy infrastructure. The Company is developing an integrated ecosystem that combines solar energy generation, battery storage, wireless electric vehicle (EV) charging, and on-demand fuel delivery by leveraging artificial intelligence (AI) and machine learning (ML) technologies. The Company is integrating sustainable energy solutions into mobile fueling operations. The Company focuses on providing renewable energy to its fueling partners, supporting efficient fuel delivery while advancing clean energy adoption. It is engaged in the deployment of NextNRG Smart Microgrids, which utilize AI-driven energy management alongside solar power and battery storage. These microgrids are designed to serve commercial properties, schools, hospitals, nursing homes, parking garages, rural and tribal lands, recreational facilities, and government properties.', 'Miami, FL, United States', 163);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CNTX', 'STOCK', 'Context Therapeutics Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Context Therapeutics Inc. is a clinical-stage biopharmaceutical company, which is engaged in advancing T cell engaging (TCE) bispecific antibodies (bsAb) for solid tumors. It is building a portfolio of TCE bispecific therapeutics, including CTIM-76, a Claudin 6 (CLDN6) x CD3 TCE, CT-95, a Mesothelin (MSLN) x CD3 TCE, and CT-202, a Nectin cell adhesion protein 4 (Nectin-4) x CD3 TCE. CLDN6 is a tight junction membrane protein target expressed in multiple solid tumors and absent from or expressed at low levels in healthy adult tissues. CT-95 is intended to redirect T-cell-mediated lysis toward malignant cells expressing MSLN. MSLN is a membrane protein overexpressed in approximately 30% of cancers. Nectin-4 is a target for cancer therapy using a traditional antibody-drug conjugate, but it is also associated with certain adverse events, including neuropathy and rash. CT-202 is a pH-dependent TCE that is designed to be preferentially active within the acidic tumor microenvironment.', 'Philadelphia, PA, United States', 12);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BHFAN', 'STOCK', 'Brighthouse Financial, Inc.', 'NMS', 'Financial Services', 'Insurance - Life', 'Brighthouse Financial, Inc. is a provider of annuities and life insurance in the United States. The Companys segments include Annuities; Life; Run-off, and Corporate & Other. The Annuities segment consists of a variety of variable, fixed, index-linked and income annuities designed to address contract holders needs for protected wealth accumulation on a tax-deferred basis, wealth transfer and income security. The Life segment consists of insurance products, including term, universal, whole and variable life products designed to address policyholders needs for financial security and protected wealth transfer, which may be on a tax-advantaged basis. The Run-off segment consists primarily of products that are no longer actively sold and are separately managed, including universal life with secondary guarantees, structured settlements, pension risk transfer contracts, certain Company-owned life insurance policies and certain funding agreements.', 'Charlotte, NC, United States', 1400);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BGY', 'STOCK', 'BlackRock Enhanced International Dividend Trust', 'NYQ', 'Financial Services', 'Asset Management', 'BlackRock Enhanced International Dividend Trust is a closed ended equity mutual fund launched by BlackRock, Inc. The fund is co-managed by BlackRock Advisors, LLC and BlackRock International Limited. It invests in public equity markets across the globe excluding the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It invests in stocks of companies across all market capitalizations. The fund also invests through the use of derivatives, with an emphasis on options writing. It benchmarks the performance of its portfolio against the S&P Global ex-U.S. Broad Market Index. The fund was formerly known as BlackRock International Growth and Income Trust. BlackRock Enhanced International Dividend Trust was formed on May 30, 2007 and is domiciled in the United States.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTNM', 'STOCK', 'Contineum Therapeutics, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Contineum Therapeutics, Inc. is a clinical-stage biopharmaceutical company, which is engaged in developing novel, oral small molecule therapies for neuroscience, inflammation and immunology (NI&I) indications with significant unmet need. It is advancing a pipeline of internally developed programs with multiple drug candidates in clinical trials. Its lead asset, PIPE-791, is a novel, brain-penetrant, small-molecule inhibitor of the lysophosphatidic acid 1 receptor (LPA1R) in development for idiopathic pulmonary fibrosis (IPF), progressive multiple sclerosis (PrMS), and chronic pain. Its second drug candidate, PIPE-307, is a novel, small-molecule selective inhibitor of the muscarinic type 1 receptor (M1R), in development for depression and relapse-remitting multiple sclerosis (RRMS). The Company is also conducting preclinical and discovery-phase experiments targeting other NI&I indications where its internally discovered molecules may have therapeutic potential.', 'San Diego, CA, United States', 41);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ANAB', 'STOCK', 'AnaptysBio, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'AnaptysBio, Inc. is a clinical-stage biotechnology company. The Company is focused on delivering immunology therapeutics for autoimmune and inflammatory diseases. The Companys lead program, Rosnilimab, is a depleter and agonist targeting PD-1+ T cells, is in a Phase IIb trial for the treatment of rheumatoid arthritis and in a Phase II trial for the treatment of ulcerative colitis. The Companys pipeline also includes ANB033, a CD122 antagonist, and ANB101, a blood dendritic cell antigen 2 (BDCA2) modulator, in Phase I trials. It has also discovered multiple therapeutic antibodies licensed to GSK in a financial collaboration for immuno-oncology, including a PD-1 antagonist (Jemperli (dostarlimab-gxly)) and a TIM-3 antagonist (cobolimab, GSK4069889). Rosnilimab is an IgG1 antibody that directly targets PD-1+ T cells, resulting in their depletion or agonism, impacting pathogenic drivers of autoimmune and inflammatory diseases.', 'San Diego, CA, United States', 136);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTMD', 'STOCK', 'biote Corp.', 'NGM', 'Healthcare', 'Medical Care Facilities', 'biote Corp. operates a practice-building business within the hormone optimization space. The Company provides the necessary components to enable Biote-certified practitioners to establish, build and implement a program designed to optimize hormone levels using personalized solutions for their patient populations. The Biote Method is a comprehensive, end-to-end practice building platform that provides Biote-certified practitioners with the components specifically developed for practitioners in the hormone optimization space: Biote Method education, training and certification, practice management software, inventory management software, and information regarding available hormone replacement therapy (HRT) products, as well as digital and point-of-care marketing support. It also sells a complementary Biote-branded line of dietary supplements. The Biote Methods proprietary clinical decision support (CDS) software assists physicians in establishing individualized dosing for patients.', 'Irving, TX, United States', 217);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ASTI', 'STOCK', 'Ascent Solar Technologies, Inc.', 'NCM', 'Technology', 'Solar', 'Ascent Solar Technologies, Inc. is a solar technology company that manufactures and sells photovoltaic (PV) solar modules. Its technology provides renewable power solutions to production and specialty solar markets where traditional rigid solar panels are not suitable, including aerospace, agrivoltaics, and niche manufacturing/construction sectors. It designs and develops finished products to design and develop integrated solutions for products, such as satellites, spacecraft, airships, and fixed wing unmanned aerial vehicles (UAVs). It is also engaged in developing its zinc oxysulfide process. The Company manufactures its products by affixing a thin Copper-Indium-Gallium-diSelenide (CIGS) layer to a plastic substrate using a large format, roll-to-roll process that permits it to fabricate its PV modules in an integrated sequential operation. It uses monolithic integration techniques, which enable it to form complete PV modules with back-end assembly of inter-cell connections.', 'Thornton, CO, United States', 16);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALTI', 'STOCK', 'AlTi Global, Inc.', 'NCM', 'Financial Services', 'Asset Management', 'AlTi Global, Inc. is an independent global wealth manager providing entrepreneurs, multi-generational families, institutions, and emerging leaders with fiduciary capabilities as well as alternative investment strategies and advisory services. Its Wealth & Capital Solutions segment provides holistic solutions for its wealth management and Outsourced Chief Investment Officer (OCIO) clients through a comprehensive array of wealth management services, including discretionary investment management services, non-discretionary investment advisory services, trust services, administration services, and family office services. Its International Real Estate segment assists its investors with real estate co-investments by providing access to highly differentiated opportunities in these areas as well as structuring and selecting partners with a proven track record in alternative asset classes, with attractive risk-adjusted return characteristics.', 'New York, NY, United States', 520);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVRX', 'STOCK', 'CVRx, Inc.', 'NMS', 'Healthcare', 'Medical Devices', 'CVRx, Inc. is a commercial-stage medical device company. The Company is focused on developing, manufacturing and commercializing advanced neuromodulation solutions for patients with cardiovascular diseases. The Company''s integrated platform technology, Barostim, is designed to leverage the power of the brain and nervous system to address the imbalance of the autonomic nervous system (ANS), which causes heart failure with reduced ejection fraction (HFrEF) and other cardiovascular diseases. Barostim provides Baroreflex Activation Therapy (BAT) by sending imperceptible and persistent electrical pulses to baroreceptors located in the wall of the carotid artery to signal the brain to modulate cardiovascular function. Barostim is a minimally invasive neuromodulation device that consists of two implantable components, an implantable pulse generator (IPG) and a stimulation lead, and is programmed by a wireless clinician-controlled programmer that communicates with the IPG.', 'Minneapolis, MN, United States', 206);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AXTI', 'STOCK', 'AXT, Inc.', 'NMS', 'Technology', 'Semiconductor Equipment & Materials', 'AXT, Inc. is a material science company that develops and manufactures high-performance compound and single element semiconductor wafer substrates comprising indium phosphide (InP), gallium arsenide (GaAs) and germanium (Ge). Its wafer substrates are used when a typical silicon wafer substrate cannot meet the performance requirements of a semiconductor or optoelectronic device. It has two product lines: specialty material substrates and raw materials integral to these substrates. Its InP is a semiconductor wafer substrate used in broadband and fiber optic applications, 5G infrastructure and data center connectivity. Its semi-conducting GaAs substrates are used to create opto-electronic products, including high brightness light emitting diodes that are often used to backlight wireless handsets and LCD televisions and for automotive, signage, and lighting applications. Its Ge substrates are used in applications, such as solar cells for space and terrestrial photovoltaic applications.', 'Fremont, CA, United States', 1527);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCEC', 'STOCK', 'Capital Clean Energy Carriers Corp.', 'NMS', 'Industrials', 'Marine Shipping', 'Capital Clean Energy Carriers Corp is a Greece-based shipping company. The Company offers maritime services and solutions in gas carriage globally, focusing on renewable energy sources. Capital Clean Energy Carriers Corp operates a fleet of technologically equipped vessels, including liquefied natural gas (LNG) carriers and Neo-Panamax container vessels. The Company''s vessels are chartered to global counterparts such as BP, Cheniere, CMA CGM, Engie, Hapag-Lloyd, Hartree, HMM, Maersk Lines, MSC, ONE, and ZIM, aiming for stable cash flows. Capital Clean Energy Carriers Corp follows policies towards greenhouse gas emissions reduction and global energy transition through shipping practices and vessel technologies.', 'Piraeus, , Greece', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALTG', 'STOCK', 'Alta Equipment Group Inc.', 'NYQ', 'Industrials', 'Rental & Leasing Services', 'Alta Equipment Group Inc. owns and operates integrated equipment dealership platforms in North America. Through its branch network, the Company sells, rents, and provides parts and service support for several categories of specialized equipment, including lift trucks and other material handling equipment, heavy and compact earthmoving equipment, crushing and screening equipment, environmental processing equipment, cranes and aerial work platforms, paving and asphalt equipment, other construction equipment and allied products. The Material Handling segment is engaged in operations related to the sale, service, and rental of lift trucks and other material handling equipment. The Construction Equipment segment is engaged in operations related to the sale, service and rental of construction equipment. The Master Distribution segment is engaged in large-scale equipment distribution rights with sub-dealers throughout the United States and Canada related to environmental processing equipment.', 'Livonia, MI, United States', 2900);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FEMY', 'STOCK', 'Femasys Inc.', 'NCM', 'Healthcare', 'Medical Instruments & Supplies', 'Femasys Inc. is a biomedical company. The Company is focused on addressing the unmet needs of women worldwide with a broad portfolio of in-office, accessible, and therapeutic and diagnostic solutions. The Company has two lead product candidates: FemBloc and FemaSeed. FemBloc is a permanent birth control solution in development. Its permanent birth control solution in development includes its FemBloc system, which features dual intrauterine directional delivery targeting both fallopian tubes with a degradable blended biopolymer. FemaSeed is an artificial insemination infertility treatment. Its artificial insemination solution in development includes its FemaSeed product candidate for artificial insemination, which features single intrauterine directional delivery. It also developed FemCerv, which is an endocervical tissue sampler for cervical cancer diagnosis; FemVue, which is a companion diagnostic for fallopian tube assessment; FemCath, which is an intrauterine catheter, and FemChec.', 'Suwanee, GA, United States', 69);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALZN', 'STOCK', 'Alzamend Neuro, Inc.', 'NCM', 'Healthcare', 'Biotechnology', 'Alzamend Neuro, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing novel products for the treatment of Alzheimer''s disease (Alzheimer''s), bipolar disorder (BD), major depressive disorder (MDD) and post-traumatic stress disorder (PTSD). The Company''s pipeline consists of two novel therapeutic drug candidates: AL001, and ALZN002. AL001 is a patented ionic cocrystal technology delivering a therapeutic combination of lithium, salicylate and L-proline through three royalty-bearing exclusive worldwide licenses from the University of South Florida Research Foundation, Inc., (the Licensor). AL001 is used for Alzheimer''s, BD, MDD and PTSD treatment. ALZN002 is a patented method using a mutant peptide sensitized cell as a cell-based therapeutic vaccine that seeks to restore the ability of a patients immunological system to combat Alzheimer''s by removing beta-amyloid from the brain through a royalty-bearing exclusive worldwide license from the Licensor.', 'Atlanta, GA, United States', 4);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACRE', 'STOCK', 'Ares Commercial Real Estate Corporation', 'NYQ', 'Real Estate', 'REIT - Mortgage', 'Ares Commercial Real Estate Corporation is a specialty finance company primarily engaged in directly originating and investing in commercial real estate loans and related investments. The Company, through its national direct origination platform, provides a broad offering of flexible and reliable financing solutions for commercial real estate owners and operators. The Company originates senior mortgage loans, as well as subordinate financings, mezzanine debt and preferred equity, with an emphasis on providing value added financing on a variety of properties located in liquid markets across the United States. Senior mortgage loans are typically secured by first liens on commercial properties, including property types, such as office, multifamily, self storage, retail, hotel, healthcare, student housing, industrial, mixed-use, residential and residential condominium. The Company is externally managed by Ares Commercial Real Estate Management LLC.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DIAX', 'STOCK', 'Nuveen Dow 30 Dynamic Overwrite Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Nuveen Dow 30 Dynamic Overwrite Fund is a closed-ended equity mutual fund launched by Nuveen Investments, Inc. The fund is co-managed by Nuveen Fund Advisors LLC and Nuveen Asset Management, LLC. It invests in the public equity markets of the United States. The fund seeks to invest in stocks of companies operating across diversified sectors. It primarily invests in stocks of large cap companies. The fund also invests through call options. It seeks to replicate the performance of Dow Jones Industrial Average. The fund was formerly known as Dow 30 Premium & Dividend Income Fund Inc. Nuveen Dow 30 Dynamic Overwrite Fund was formed on April 29, 2005 and is domiciled in the United States.', 'Chicago, IL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTO', 'STOCK', 'CTO Realty Growth, Inc.', 'NYQ', 'Real Estate', 'REIT - Diversified', 'CTO Realty Growth, Inc. is a real estate investment trust that owns and operates a portfolio of retail-based properties located primarily in the United States. The Companys segments include income properties, management services, commercial loans and investments, and real estate operations. The management services segment is a fee-based management business that is engaged in managing Alpine Income Property Trust, Inc. (PINE). The commercial loans and investments segment includes a portfolio of five commercial loan investments and two preferred equity investments, which are classified as commercial loan investments. Its income property operations consist of income-producing properties. Its business also includes its investment in PINE. Its portfolio of properties includes Carolina Pavilion, Millenia Crossing, Lake Brandon Village, Crabby''s Oceanside, Fidelity, LandShark Bar & Grill, Granada Plaza and The Strand at St. Johns Town Center, The Shops at Legacy, Price Plaza, and others.', 'Winter Park, FL, United States', 37);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ALLW', 'STOCK', 'SPDR Bridgewater ALL Weather ETF', 'NGM', NULL, NULL, 'SSGA Funds Management, Inc. (the “Adviser” or “SSGA FM”), the investment adviser to the fund, seeks to achieve the fund''s investment objective by investing the fund''s assets based on a model portfolio provided by Bridgewater Associates, LP (the “Sub-Adviser” or “Bridgewater”), the investment sub-adviser to the fund.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AX', 'STOCK', 'Axos Financial, Inc.', 'NYQ', 'Financial Services', 'Banks - Regional', 'Axos Financial Inc. is the holding company for Axos Bank (the Bank), Axos Clearing LLC and Axos Invest, Inc. The Bank provides consumer and commercial banking products through its digital online and mobile banking platforms. Its segments include Banking Business and Securities Business. The Banking Business Segment includes a broad range of banking services, including online banking, concierge banking, and mortgage, vehicle and unsecured lending through online, low-cost distribution channels to serve the needs of consumers and small businesses nationally. In addition, the Banking Business Segment focuses on depositing products nationwide to industry verticals. The Securities Business Segment includes the clearing broker-dealer, registered investment advisor custody business, and introducing broker-dealer lines of businesses. These lines of business offer products independently to their own customers as well as to Banking Business Segment clients.', 'Las Vegas, NV, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENTX', 'STOCK', 'Entera Bio Ltd.', 'NCM', 'Healthcare', 'Biotechnology', 'Entera Bio Ltd is an Israel-based clinical-stage biopharmaceutical company focused on the development and commercialization of orally delivered large molecule therapeutics for use in areas with unmet medical need and where adoption of injectable therapies is limited due to cost, convenience and compliance challenges for patients. The Company developed a platform that enables the oral delivery of injectable proteins and large molecules. Entera Bio candidates are EB613 for the treatment of osteoporosis and EB612 for the treatment of hypoparathyroidism. Both EB613 and EB612 are oral formulations of human parathyroid hormone (1-34), or Parathormon (PTH). The products are administered via injection.', 'Jerusalem, , Israel', 18);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EOD', 'STOCK', 'Wells Fargo Advantage Funds - Allspring Global Dividend Opportunity Fund', 'NYQ', 'Financial Services', 'Asset Management', 'Wells Fargo Advantage Funds - Allspring Global Dividend Opportunity Fund is a closed-ended equity mutual fund launched and managed by Wells Fargo Funds Management, LLC. It is co-managed by Crow Point Partners, LLC and Wells Capital Management Incorporated. The fund invests in the public equity markets across the globe. It invests in stocks of companies operating across diversified sectors with an emphasis on utilities, telecom, and energy sectors. The fund primarily invests in dividend paying stocks of companies. Wells Fargo Advantage Funds - Allspring Global Dividend Opportunity Fund was formed on March 28, 2007 and is domiciled in the United States.', 'Charlotte, NC, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARTV', 'STOCK', 'Artiva Biotherapeutics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Artiva Biotherapeutics, Inc. is a clinical-stage biotechnology company. The Company is focused on developing natural killer (NK) cell-based therapies for patients suffering from devastating autoimmune diseases and cancers. Its product candidates are derived from donor cells (allogeneic) rather than a patient''s own cells (autologous) and are pre-manufactured, stored frozen and ready to ship to a patient''s treatment location. Its lead product candidate, AlloNK, is being evaluated in combination with B-cell targeted monoclonal antibodies (mAbs) in patients with autoimmune diseases and cancers, such as systemic lupus erythematosus (SLE), lupus nephritis (LN), RA, PV, the ANCA-associated vasculitis subtypes GPA/MPA, and B-NHL. AlloNK is a non-genetically modified, cryopreserved NK cell therapy being evaluated in combination with B-cell targeted mAbs in an ongoing Phase I/Ib trial in SLE with or without LN and a basket investigator-initiated trial (IIT) in multiple autoimmune indications.', 'San Diego, CA, United States', 105);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BANL', 'STOCK', 'CBL International Limited', 'NCM', 'Energy', 'Oil & Gas Midstream', 'CBL International Ltd is a company engaged in the provision of marine fuel logistics services. The Company is engaged in the provision of one-stop solutions for vessel refueling. The Companys target customer includes container liner operators. The Company operates its business in Malaysia, Hong Kong and Singapore.', 'Kuala Lumpur, , Malaysia', 39);\n
